package com.coderhouse.prueba;

public class MaxPrueba {
	private String nombre; 
	private String apepllido;
	private Integer edad;
	public MaxPrueba() {
		super();
		// TODO Auto-generated constructor stub
	}
	public MaxPrueba(String nombre, String apepllido, Integer edad) {
		super();
		this.nombre = nombre;
		this.apepllido = apepllido;
		this.edad = edad;
	}
	public String getNombre() {
		return nombre;
	}
	public void setNombre(String nombre) {
		this.nombre = nombre;
	}
	public String getApepllido() {
		return apepllido;
	}
	public void setApepllido(String apepllido) {
		this.apepllido = apepllido;
	}
	public Integer getEdad() {
		return edad;
	}
	public void setEdad(Integer edad) {
		this.edad = edad;
	} 
	
	
	

}
